    title: "Needle Knight Leda's Questline",
    description:
      "**How to Begin:** Pick up the [Tower of Shadow Message](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=380804). You must have spoken to Leda before entering the Shadow Realm for the quest to properly trigger.  \n**Steps:**\n1. Read the [Castle Cross Message](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381194)\n2. Speak to [Needle Knight Leda](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=380252)\n3. Break the Great Rune; approach [Shadow Keep](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381342) until you get a game notification that \"somewhere, a great rune has broken\".\n4. Speak with Needle Knight Leda again.\n5. Complete [Leda's Questline (1st battle)](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381987) (see the battle for choice repercussions)\n6.  Speak with Needle Knight Leda to receive the [Lacerating Crossed-Tree](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=386478).\n7. Complete [Leda's Questline (2nd battle)](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381988) (see the battle for choice repercussions)\n8. Speak with Needle Knight Leda to receive the [Retaliatory Crossed-Tree Talisman](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=386477).\n9. Defeat [Needle Knight Leda](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=384098)",
    latitude: "0.68231906989166",
    longitude: "-0.75201496481793",
