    regionSlug: "the-shadow-realm",
    categoryTitle: "Quest",
    title: "Sir Ansbach's Questline",
    description:
      "**How to Begin:** Speak with [Sir Ansbach](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=380752)  \n**Steps:**\n1. Interact with the [Miquella's Cross](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=382123)\n2. Speak with Sir Ansbach again.\n3. Break the Great Rune; approach [Shadow Keep](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381342) until you get a game notification that \"somewhere, a great rune has broken\".\n4. Speak with Sir Ansbach in his [new location](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=382217).\n5. Read the [Storehouse Cross Message](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381713)\n6. Speak with [Redmane Freyja](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=383036)\n7. Speak with Ansbach again; he will give you a letter to give to Freyja.\n8. Acquire the [Secret Rite Scroll](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381721)\n9. Give the scroll to Ansbach.\n10. Complete [Leda's Questline (2nd battle)](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=381988) (see the battle for each choice's outcomes).\n11. Summon Ansbach against [Promised Consort Radahn](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=382044). If you do, you will receive [Ansbach's Set](https://mapgenie.io/elden-ring/maps/the-shadow-realm?locationIds=386515) after defeating him.\n\n**Note:** Steps 6 and 7 are optional, but required for ??.",
